import { Popup } from '../../layout';

export interface ICart {
  isOpen: boolean;
  setOpen: (params: any) => any;
}

const Cart: React.FC<ICart> = ({ isOpen, setOpen }) => {
  return (
    <Popup isOpen={isOpen} setOpen={setOpen}>
      <div>

      </div>
    </Popup>
  )
}

export default Cart;
